import React, { useEffect } from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";

function Em(props) {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: { employee: props.employee, employees: props.employees },

    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));
 

  return (
    <div>
      <div className="container">
        <div className="navigation">
          <div className="previous btn-nav">{`<`} </div>
          <div className="next btn-nav">{`>`}</div>
        </div>
        <div className="sarousel-container">
          <div className="image-fade fade">
            <img
              src={`${props.employee.Avatar.url}`}
              style={{ width: "100%" }}
            ></img>
            <div className="caption-text">{`${props.employee.Name}`}</div>
          </div>
        </div>
      </div>

      <div style={{ textAlign: "center" }}>
        <span className="dot"></span>
      </div>
    </div>
  );
}

export default Employee;
